.container {
  position: relative;
  line-height: normal;
  cursor: pointer;
  height: 20px;
  margin: 0;
  padding: 0;
  user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -moz-user-select: none;
}
.bar {
  top: 8px;
  width: 100%;
  height: 4px;
  vertical-align: middle;
  position: relative;
}
.value_bar {
  height: 4px;
  /*border-radius: 3px;*/
  position: absolute
}
.btn {
  position: absolute;
  margin-left: -6px;
  top: -4px;
  width: 12px;
  height: 12px;
  border-width: 2px;
  border-style: solid;
  border-radius: 50%;
  background-color: #fff;
  outline: 0;
}
.sign {
  position: absolute;
  margin-left: -5px;
  top: -3px;
  width: 10px;
  height: 10px;
  border-width: 1px;
  border-style: solid;
  border-radius: 50%;
  background-color: #fff;
  outline: 0;
}
.tooltip {
  position: absolute;
  top: -35px;
  padding: 4px 6px;
  border-width: 1px;
  border-style: solid;
  white-space: nowrap;
  background-color: #FCF0C1;
  z-index: 99999;
}
/* 禁止操作 */
.disabled {
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  background-color: rgba(255, 255, 255, 0.6);
  opacity: 0.6;
  filter: alpha(opacity=60); 
  cursor: not-allowed;
}
